function getDateStr(date, days) {
  let lastDate = new Date((new Date(date)).getTime() + 1000 * 60 * 60 * 24 * days);
  let y = lastDate.getFullYear();
  let m = lastDate.getMonth() + 1;
  let d = lastDate.getDate();
  if (m<= 9){
    m = "0"+m;
  }
  if (d <= 9){
    d = "0"+d;
  }
  return y + "-" + m + "-" + d;
}

